jQuery(function(t) {
	t.blockUI.defaults.overlayCSS.cursor = 'default';
	var n = {
			$tax_form: t('form.ea-tax-form'),
			init: function() {
				this.validateForm();
			},
			validateForm: function() {
				this.$tax_form.validate({
					rules: { rate: { number: !0 } },
					errorPlacement: function() {
						return !0;
					},
					submitHandler: this.submit(),
				});
			},
			submit: function() {},
		},
		r = {
			$tax_form: t('form.ea-currency-form'),
			init: function() {
				this.validateForm();
			},
			validateForm: function() {
				this.$tax_form.validate({
					rules: { rate: { number: !0 } },
					errorPlacement: function() {
						return !0;
					},
					submitHandler: this.submit(),
				});
			},
			submit: function() {},
		},
		i = {
			$account_form: t('form.ea-account-form'),
			init: function() {
				t(document.body)
					.on('change', '#currency_code', this.handleCurrency)
					.trigger('change');
			},
			handleCurrency: function() {
				console.log('changed');
			},
			submit: function() {},
		};
	n.init(), r.init(), i.init();
});
